let start = undefined;
let end = undefined;
const MutantLineSequenceCounter = require('./services/mutant_line_sequence_counter');
const sequence = '';
function performSequence(sequence) {
  const length = sequence.length;
  let pivot = undefined;
  let count = 0;
  let y = undefined;
  let sc = 0;
  for(let x = 0; x < length;) {
    pivot = sequence[x];
    y = x;
    count = 0;
    while(pivot == sequence[y++]) {
      count++;
      if(count >= 4) {
        sc += 1;
        break;
      }
      if(sc > 1)
        return sc;
    }
    x = y;
  }
  return sc;
}
start = Date.now();
console.log(performSequence(sequence));
end = Date.now();
console.log(`Execution time: ${end - start} ms`);
